import * as React from 'react';

export interface ButtonProps {
  submitPrice: any;
  updatePrice: any;
  query: any;
  price: any;
  mutationLoading: any;
}

const Button: React.SFC<ButtonProps> = ({ children, mutationLoading }) => {
  return (
    <button
      type="submit"
      className="btn btn-outline-primary float-right"
      disabled={mutationLoading}
    >
      {children}
    </button>
  );
};

export default Button;
